import React from "react";

// reactstrap components
import { Container } from "reactstrap";

function DarkFooter() {
  return (
    <footer className="footer" data-background-color="black">
         <Container>
        <p>2019 Ravenscroft Games</p>
        </Container>
    </footer>
  );
}

export default DarkFooter;
